_graph_cache = None

def build_graph(env: Any) -> nx.DiGraph:
    global _graph_cache
    if _graph_cache is None:
        G = nx.DiGraph()
        road_data = env.get_road_network_data()
        for edge in road_data['edges']:
            G.add_edge(edge['from_node'], edge['to_node'], weight=edge['distance'])
        _graph_cache = G
    return _graph_cache

@lru_cache(maxsize=5000)
def get_distance_cached(node1: int, node2: int, graph_id: int) -> float:
    """Cached distance lookup"""
    # Note: graph_id is for cache invalidation
    return 0.0  # Placeholder

def get_distance(env: Any, node1: int, node2: int) -> float:
    G = build_graph(env)
    try:
        return nx.shortest_path_length(G, node1, node2, weight='weight')
    except:
        return float('inf')


# ============================================================================
# GREEDY ASSIGNMENT (PRIMARY STRATEGY)
# ============================================================================

def greedy_assignment_optimized(env: Any) -> Tuple[Dict, Dict]:
    """
    Greedy assignment optimized for tight capacity scenarios.
    
    Strategy:
    1. Sort orders by size (weight+volume) - LARGEST FIRST
    2. For each order, find best vehicle (most remaining capacity)
    3. Choose closest warehouse with inventory
    4. Pack efficiently to maximize fulfillment
    """
    order_assignments = {v.id: {} for v in env.get_all_vehicles()}
    vehicle_states = {}
    
    # Initialize vehicle states
    for v in env.get_all_vehicles():
        vehicle_states[v.id] = {
            'rem_weight': v.capacity_weight,
            'rem_volume': v.capacity_volume,
            'home_wh': v.home_warehouse_id,
            'home_node': env.warehouses[v.home_warehouse_id].location.id,
            'assigned_orders': []
        }
    
    # Get all orders with size info
    order_info = []
    for order_id in env.get_all_order_ids():
        req = env.get_order_requirements(order_id)
        order = env.orders[order_id]
        weight = sum(env.skus[sku].weight * qty for sku, qty in req.items())
        volume = sum(env.skus[sku].volume * qty for sku, qty in req.items())
        
        order_info.append({
            'id': order_id,
            'weight': weight,
            'volume': volume,
            'dest_node': order.destination.id,
            'req': req,
            'size_score': weight + volume * 200  # Prioritize volume (more constrained)
        })
    
    # Sort: LARGEST FIRST (better bin packing)
    order_info.sort(key=lambda x: x['size_score'], reverse=True)
    
    assigned_count = 0
    
    for order_data in order_info:
        order_id = order_data['id']
        weight = order_data['weight']
        volume = order_data['volume']
        dest_node = order_data['dest_node']
        req = order_data['req']
        
        # Find best vehicle-warehouse combination
        best_combo = None
        best_score = float('inf')
        
        # Try all vehicles
        for v_id, v_state in vehicle_states.items():
            # Check capacity
            if weight > v_state['rem_weight'] or volume > v_state['rem_volume']:
                continue
            
            # Find best warehouse for this vehicle
            for wh_id, wh in env.warehouses.items():
                # Check inventory
                inv = env.get_warehouse_inventory(wh_id)
                has_inv = all(inv.get(sku, 0) >= qty for sku, qty in req.items())
                if not has_inv:
                    continue
                
                # Calculate cost: warehouse to destination + home to warehouse
                wh_node = wh.location.id
                home_node = v_state['home_node']
                
                wh_to_dest = get_distance(env, wh_node, dest_node)
                home_to_wh = get_distance(env, home_node, wh_node)
                
                # Score: total distance + capacity penalty (prefer vehicles with more space)
                capacity_ratio = weight / v_state['rem_weight']
                score = wh_to_dest + home_to_wh * 0.3 + capacity_ratio * 1000
                
                if score < best_score:
                    best_score = score
                    best_combo = (v_id, wh_id)
        
        # Assign if found
        if best_combo:
            v_id, wh_id = best_combo
            order_assignments[v_id][order_id] = wh_id
            vehicle_states[v_id]['rem_weight'] -= weight
            vehicle_states[v_id]['rem_volume'] -= volume
            vehicle_states[v_id]['assigned_orders'].append(order_id)
            assigned_count += 1
    
    print(f"Greedy assigned: {assigned_count}/{len(order_info)} orders")
    return order_assignments, vehicle_states


# ============================================================================
# ROUTE BUILDING
# ============================================================================

def build_routes_simple(env: Any, order_assignments: Dict, vehicle_states: Dict) -> Dict:
    """Build routes with simple nearest-neighbor ordering"""
    routes = []
    
    for v_id, orders in order_assignments.items():
        if not orders:
            continue
        
        vehicle = next(v for v in env.get_all_vehicles() if v.id == v_id)
        home_node = env.warehouses[vehicle.home_warehouse_id].location.id
        
        # Collect all stops
        stops = []
        for order_id, wh_id in orders.items():
            wh = env.warehouses[wh_id]
            order = env.orders[order_id]
            req = env.get_order_requirements(order_id)
            
            stops.append({
                'type': 'pickup',
                'node': wh.location.id,
                'wh_id': wh_id,
                'order_id': order_id,
                'skus': req
            })
            stops.append({
                'type': 'delivery',
                'node': order.destination.id,
                'order_id': order_id,
                'skus': req
            })
        
        # Order stops by nearest neighbor (simple TSP approximation)
        ordered_stops = _nearest_neighbor_order(env, stops, home_node)
        
        # Build step sequence
        steps = [{"node_id": home_node, "pickups": [], "deliveries": [], "unloads": []}]
        current_node = home_node
        
        for stop in ordered_stops:
            # Path to stop
            G = build_graph(env)
            try:
                path = nx.shortest_path(G, current_node, stop['node'], weight='weight')
                
                for node in path[1:]:
                    if node == stop['node']:
                        step = {"node_id": node, "pickups": [], "deliveries": [], "unloads": []}
                        if stop['type'] == 'pickup':
                            for sku, qty in stop['skus'].items():
                                step["pickups"].append({
                                    "warehouse_id": stop['wh_id'],
                                    "sku_id": sku,
                                    "quantity": qty
                                })
                        else:
                            for sku, qty in stop['skus'].items():
                                step["deliveries"].append({
                                    "order_id": stop['order_id'],
                                    "sku_id": sku,
                                    "quantity": qty
                                })
                        steps.append(step)
                    else:
                        steps.append({"node_id": node, "pickups": [], "deliveries": [], "unloads": []})
                
                current_node = stop['node']
            except:
                pass
        
        # Return home
        if current_node != home_node:
            G = build_graph(env)
            try:
                path = nx.shortest_path(G, current_node, home_node, weight='weight')
                for node in path[1:]:
                    steps.append({"node_id": node, "pickups": [], "deliveries": [], "unloads": []})
            except:
                pass
        
        routes.append({"vehicle_id": v_id, "steps": steps})
    
    return {"routes": routes}


def _nearest_neighbor_order(env: Any, stops: List[Dict], start_node: int) -> List[Dict]:
    """Order stops using nearest neighbor heuristic"""
    if not stops:
        return []
    
    ordered = []
    remaining = stops[:]
    current = start_node
    
    while remaining:
        # Find nearest stop
        best_idx = 0
        best_dist = get_distance(env, current, remaining[0]['node'])
        
        for i in range(1, len(remaining)):
            dist = get_distance(env, current, remaining[i]['node'])
            if dist < best_dist:
                best_dist = dist
                best_idx = i
        
        # Add to ordered list
        stop = remaining.pop(best_idx)
        ordered.append(stop)
        current = stop['node']
    
    return ordered


# ============================================================================
# MAIN SOLVER
# ============================================================================

def solver(env: Any) -> Dict:
    """Main solver - Greedy-first approach"""
    global _graph_cache
    _graph_cache = None
    get_distance_cached.cache_clear()
    
    # Use greedy assignment (more robust for tight scenarios)
    order_assignments, vehicle_states = greedy_assignment_optimized(env)
    
    # Build routes
    solution = build_routes_simple(env, order_assignments, vehicle_states)
    
    return solution
